import Banner from "../Agendamento/banner/Banner"

const Perfil = () => {
    return(
        <div className="containerMainPerfil">
                <div className="containerBannerPerfil">
                    <Banner/>
                    <Banner/>
                </div>
        </div>
    )
}

export default Perfil;
